import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function Dashboard() {
  const [stats, setStats] = useState({ totalniCastka: 0, pocetProdeju: 0 });
  const [pocetNeprodanych, setPocetNeprodanych] = useState(0);
  const [pocetAktivnichProhlidek, setPocetAktivnichProhlidek] = useState(0);

  useEffect(() => {
    // Načtení statistik prodeje
    fetch("http://localhost:3001/api/dashboard")
      .then((response) => response.json())
      .then((data) => setStats(data))
      .catch((error) => console.error("Chyba při načítání statistik:", error));

    // Načtení počtu neprodaných nemovitostí
    fetch("http://localhost:3001/api/nemovitosti/neprodane")
      .then((response) => response.json())
      .then((data) => setPocetNeprodanych(data.pocetNeprodanych))
      .catch((error) =>
        console.error("Chyba při načítání neprodaných nemovitostí:", error)
      );

    // Načtení počtu aktivních prohlídek
    fetch("http://localhost:3001/api/prohlidky/aktivni")
      .then((response) => response.json())
      .then((data) => setPocetAktivnichProhlidek(data.pocetAktivnich))
      .catch((error) =>
        console.error("Chyba při načítání aktivních prohlídek:", error)
      );
  }, []);

  return (
    <div className="container">
      <header
        style={{ display: "flex", alignItems: "center", marginBottom: "2rem" }}
      >
        <Link
          to="/dashboard"
          style={{
            display: "flex",
            alignItems: "center",
            textDecoration: "none",
            color: "inherit",
          }}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="#2563eb"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            style={{ marginRight: "0.5rem" }}
          >
            <path d="M3 9l9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path>
            <polyline points="9 22 9 12 15 12 15 22"></polyline>
          </svg>
          <h1 style={{ fontSize: "1.5rem", margin: 0 }}>ProperTea</h1>
        </Link>
      </header>

      <nav style={{ marginBottom: "2rem" }}>
        <Link
          to="/dashboard"
          style={{
            marginRight: "1rem",
            color: "#2563eb",
            textDecoration: "none",
            fontWeight: "bold",
          }}
        >
          Dashboard
        </Link>
        <Link
          to="/nemovitosti"
          style={{
            color: "#2563eb",
            textDecoration: "none",
            fontWeight: "bold",
          }}
        >
          Nemovitosti
        </Link>
      </nav>

      <h2>Statistiky prodeje 2025</h2>
      <div style={{ display: "flex", gap: "2rem", marginBottom: "2rem" }}>
        <div
          style={{
            padding: "1rem",
            border: "1px solid #ccc",
            borderRadius: "8px",
            flex: 1,
            textAlign: "center",
          }}
        >
          <h3>Celková částka</h3>
          <p style={{ fontSize: "1.5rem", color: "#2563eb" }}>
            {stats.totalniCastka.toLocaleString("cs-CZ")} Kč
          </p>
        </div>
        <div
          style={{
            padding: "1rem",
            border: "1px solid #ccc",
            borderRadius: "8px",
            flex: 1,
            textAlign: "center",
          }}
        >
          <h3>Počet prodejů</h3>
          <p style={{ fontSize: "1.5rem", color: "#2563eb" }}>
            {stats.pocetProdeju}
          </p>
        </div>
      </div>

      <h2>Overview</h2>
      <div
        style={{
          padding: "1rem",
          border: "1px solid #ccc",
          borderRadius: "8px",
          display: "flex",
          gap: "2rem",
        }}
      >
        <div>
          <h3>Real estates</h3>
          <p style={{ fontSize: "1.5rem", color: "#2563eb" }}>
            {pocetNeprodanych}
          </p>
        </div>
        <div>
          <h3>Showings</h3>
          <p style={{ fontSize: "1.5rem", color: "#2563eb" }}>
            {pocetAktivnichProhlidek}
          </p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
